import View from '../lib/ViewContext';
import GroceryForm from '../components/GroceryForm';
import GroceryList from '../components/GroceryList';

const Home = (props) => {
  console.log(props);

  return (
    <View>
      <GroceryForm />
      <GroceryList {...props} />
    </View>
  );
};

export default Home;
